window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"27.2.0","implementation":{"name":"cucumber-jvm","version":"7.21.1"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"21.0.5+9-LTS-239"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1740164131,"nanos":933797900}}},{"source":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/01_Login.feature","data":"@Loginpage @LMS\r\nFeature: Login page validation\r\n\r\n  Background:\r\n    Given Admin launch the browser and Admin is in login Page\r\n\r\n  @Logincredentials\r\n  Scenario Outline: Validate login with valid and invalid credentials\r\n    When Admin enter valid \"<credentials>\"  and selects \"Admin\" from the dropdown  \r\n  And clicks the login button  \r\n    Then Admin should see the \"<result>\"\r\n    Examples:\r\n    | credentials              | result                  |\r\n    | valid credentials        | Admin should land on dashboard page             |\r\n    |invalid credentials        | Invalid username and password Please try again |\r\n    | onlypassword                 | Please enter your user name |\r\n    | onlyusername                 | Please enter your password  |\r\n    \r\n    @keyboardLogin\r\n Scenario: verify login button action through keyboard\r\n   When Admin enter valid credentials  and clicks login button through keyboard\r\n   Then Admin should land on dashboard page\r\n\r\n  @mouseLogin\r\n Scenario: verify login button action through mouse\r\n   When Admin enter valid credentials  and clicks login button through mouse\r\n   Then Admin should land on dashboard page\r\n\r\n    @spellcheck\r\n  Scenario: Verify the text spelling in the page\r\n    Then Admin should see correct spellings in all fields\r\n\r\n@LogoValidate\r\n  Scenario: Verify the company logo\r\n    Then Admin should see logo on the left  side\r\n\r\n  @AppNameValidate\r\n  Scenario:Verify application name\r\n    Then Admin should see  LMS - Learning Management System\r\n\r\n  @CompanyNameValidate\r\n  Scenario: Verify company name\r\n    Then Admin should see company name below the app name\r\n\r\n  @LoginLMSContent\r\n  Scenario: Validate sign in content\r\n    Then Admin should see \"Please login to LMS application\"\r\n\r\n  @CountTextField\r\n  Scenario: Verify text field is present\r\n    Then Admin should see two text field\r\n\r\n    @UserFirst\r\n  Scenario: Verify text on the first text field\r\n    Then Admin should \"User\" in the first text field\r\n\r\n    @asteriskUser\r\n  Scenario: Verify asterisk next to Admin text\r\n    Then Admin should see field mandatory asterisk symbol next to Admin text\r\n\r\n  @PasswordSecond\r\n  Scenario: Verify text on the second text field\r\n    Then Admin should \"Password\" in the second text field\r\n    \r\n    @Dropdown\r\n    Scenario: Verify dropdown is present\r\n  Then Admin should see one dropdown\r\n  \r\n    Scenario: Verify placeholder in dropdown to select role\r\n    \r\n    Then Admin should see \"select the role\" placeholder in the dropdown\r\n\r\n  Scenario: Verify dropdown option to select role\r\n    \r\n    Then Admin should see \"Admin, Staff, Student\" options in the dropdown\r\n\r\n  \r\n    @asteriskPassword\r\n  Scenario: Verify asterisk next to password text\r\n    Then Admin should see * symbol next to password text\r\n\r\n  Scenario: Verify the alignment input field for the login\r\n    Then Admin should see input field on the centre of the page\r\n\r\n    @loginButtonAvailable\r\n  Scenario: verify Login button is present\r\n    Then Admin should see login button\r\n\r\n  Scenario: Verify the alignment of the login button\r\n    Then Admin should see login button on the centre of the page\r\n\r\n    @userColor\r\n  Scenario:Verify input descriptive test in Admin field\r\n    Then Admin should see Admin in gray color\r\n\r\n  @passwordColor\r\n  Scenario: Verify input de cks login button\r\n    Then Admin should see the navigation bar text on the top right side\r\n    \r\n  @MenuOrder\r\n  Scenario Outline: Validate navigation bar order\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see \"<Menu>\" in the \"<Order>\"\r\n\r\n    Examples: \r\n      |  Menu    | Order |\r\n      | Home     |   1   |\r\n      | Program  |   2   |\r\n      | Batch    |   3   |\r\n      | Class    |   4   |\r\n      | Logout   |   5   | \r\n      \r\n  @PieChart\r\n  Scenario: verify pie-chart presence\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see piechart\r\n    \r\n  @UsrDetail\r\n  Scenario: Verify user details\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see welcome message with user name and role \r\n       \r\n  @BarChart\r\n  Scenario: Verify bar chart\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see bar chart for Active and inactive user\r\n    \r\n  @LMSCount\r\n  Scenario Outline: Verify section count\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see \"<Section>\" count\r\n\r\n    Examples: \r\n\r\n      |   Section  | \r\n      |   User     |\r\n      |   Staff    |\r\n      |   Batch    |\r\n      |   Program  |\r\n      \r\n  @PaginationIcon\r\n  Scenario: Verify staff table pagination\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see staff table with pagination icons\r\n    \r\n  @Staff5Data\r\n  Scenario: Verify staff data page split\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see five staff data in a page\r\n    \r\n  @LMSCount\r\n  Scenario Outline: verify page icon disable\r\n    Given Admin is on login Page\r\n    When Admin enter valid data in all field and clicks login button\r\n    Then Admin should see \"<PageArrow>\" page icon disabled\r\n\r\n    Examples: \r\n\r\n      |   PageArrow  | \r\n      |   Previous   |\r\n      |   FirstPage  |  \r\n      \r\n    ","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/02_Dashboard.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Dashboard","id":"b639670d-55c1-414c-9dfd-392d7ca1bd11"},{"location":{"line":1,"column":12},"name":"@LMS","id":"f34d798f-48d1-4ded-9ea4-0621a9d0fdb2"},{"location":{"line":1,"column":17},"name":"@Dash","id":"e0c89f5f-747e-48eb-8627-f2885c553839"}],"language":"en","keyword":"Feature","name":"Dashboard Functionality","description":"","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[{"location":{"line":4,"column":3},"name":"@Title","id":"6b018352-79f1-4953-b3fa-f20040b9d7b8"}],"keyword":"Scenario","name":"Verify LMS title","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"Admin is on login Page","id":"9c717d92-7039-4be2-a1f6-471c948851c0"},{"location":{"line":7,"column":5},"keyword":"When ","keywordType":"Action","text":"Admin enter valid data in all field and clicks login button","id":"548315f7-e752-463b-be50-e4a0297d66e2"},{"location":{"line":8,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"Admin should see LMS -Learning management system as title","id":"4a4c91c2-ae38-46cc-9969-c7e6938c56bd"}],"examples":[],"id":"3edfd8c3-7787-48bd-809b-66718a03723a"}},{"scenario":{"location":{"line":11,"column":3},"tags":[{"location":{"line":10,"column":3},"name":"@  disabled"}],"tags":[{"name":"@Dashboard","astNodeId":"b639670d-55c1-414c-9dfd-392d7ca1bd11"},{"name":"@LMS","astNodeId":"f34d798f-48d1-4ded-9ea4-0621a9d0fdb2"},{"name":"@Dash","astNodeId":"e0c89f5f-747e-48eb-8627-f2885c553839"},{"name":"@LMSCount","astNodeId":"f4af08d6-7d42-44cf-8227-d7f3e0f10824"}],"astNodeIds":["cd855ebe-0c4f-42cb-a3ec-8dde20264fbb","6368ec40-a119-498c-8f18-a69396564d3f"]}},{"pickle":{"id":"72d3fcd0-3e63-44bc-8785-0cfccf2be535","uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/02_Dashboard.feature","name":"verify page icon disable","language":"en","steps":[{"astNodeIds":["2571bc61-8769-46f4-addb-ec6f9f60d809","b79d66c2-0295-41ec-b62e-9f0cd22b5f41"],"id":"3cb2ef74-1ad3-47be-8cab-2f2be2486628","type":"Context","text":"Admin is on login Page"},{"astNodeIds":["a6e47860-8987-447a-a868-8c3fb5bb55a0","b79d66c2-0295-41ec-b62e-9f0cd22b5f41"],"id":"66809db7-c137-4e28-951e-570a6c6bd130","type":"Action","text":"Admin enter valid data in all field and clicks login button"},{"astNodeIds":["7d6be9b3-dd45-4588-b544-80a9b67c1815","b79d66c2-0295-41ec-b62e-9f0cd22b5f41"],"id":"cad39469-55be-4dcf-a1c3-cc4fc090d47f","type":"Outcome","text":"Admin should see \"FirstPage\" page icon disabled"}],"tags":[{"name":"@Dashboard","astNodeId":"b639670d-55c1-414c-9dfd-392d7ca1bd11"},{"name":"@LMS","astNodeId":"f34d798f-48d1-4ded-9ea4-0621a9d0fdb2"},{"name":"@Dash","astNodeId":"e0c89f5f-747e-48eb-8627-f2885c553839"},{"name":"@LMSCount","astNodeId":"f4af08d6-7d42-44cf-8227-d7f3e0f10824"}],"astNodeIds":["cd855ebe-0c4f-42cb-a3ec-8dde20264fbb","b79d66c2-0295-41ec-b62e-9f0cd22b5f41"]}},{"source":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/03_Program.feature","data":"Feature: Manage Page Validation\r\n\r\n  #These all steps are from login Module\r\nBackground: Admin is logged in to LMS Portal\r\nGiven Admin is in login Page to test Program module\r\nWhen Admin enter valid credentials  and clicks login button through keyboard for Program module\r\nThen Admin should land on dashboard page On Program module\r\n\r\n  #This step is common in class module Given Admin is on dashboard page after Login\r\nScenario: Verify that Admin is able to navigate to Program module\r\n    When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should be navigated to Program module\r\n   #---------------------------------------------------------------------------------- \r\n    Scenario: Verify heading in menu bar  \r\n    When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see the heading \"LMS - Learning Management System\" for program\r\n    \r\nScenario: Verify other modules name displayed in menu bar\r\n    #Given Admin is on dashboard page after Login\r\n    When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see the module names as in order \"Program Batch Class \" for program\r\n    \r\nScenario: Verify Logout displayed in menu bar\r\n    #Given Admin is on dashboard page after Login\r\n    When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see \"Logout\" in menu bar for program\r\n    \r\nScenario: Verify sub menu displayed in program menu bar\r\n   # Given Admin is on program page\r\n    When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see sub menu in menu bar as \"Add New Program\" for program\r\n    #--------------------------------------------------------------------------------------\r\n    Scenario: Verify heading in manage program\r\n    #Given Admin is on dashboard page after Login\r\n    When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see the heading  \"Manage Program\" for each program\r\n    \r\n   #2 \r\nScenario: Verify view details of programs\r\n    #Given Admin is on dashboard page after Login\r\n   When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should able to see Program name, description, and status for each program\r\n  \r\n  #3  \r\nScenario: Verify the Multiple Delete button state \r\n    #Given Admin is on dashboard page after Login\r\n   When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see a Delete button in left top is disabled\r\n \r\n  #4  \r\nScenario: Verify the Search button  \r\n    #Given Admin is on dashboard page after Login\r\n   When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see Search bar with text as \"Search...\"\r\n \r\n #5   \r\n#Scenario: Verify column header name of data table  \r\n    #Given Admin is on dashboard page after Login\r\n  # When  Admin clicks \"Program\" on the navigation bar in program module\r\n    #Then Admin should see data table with column header on the Manage Program Page as  Program Name, Program Description, Program Status, Edit\/Delete\r\n \r\n #6   \r\nScenario: Verify checkbox default state beside Program Name column header\r\n   # Given Admin is on dashboard page after Login\r\n   When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see checkbox default state as unchecked beside Program Name column header\r\n #7    \r\nScenario: Verify checkboxes default state beside each Program names in the data table\r\n   # Given Admin is on dashboard page after Login\r\n    When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see check box default state as unchecked on the left side in all rows against program name \r\n \r\n #8   \r\nScenario: Verify Sort icon in manage program\r\n    #Given Admin is on dashboard page after Login\r\n    When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see the sort arrow icon beside to each column header except Edit and Delete \r\n #9    \r\nScenario: Verify edit and delete icon in manage program\r\n    #Given Admin is on dashboard page after Login\r\n    When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see the Edit and Delete buttons on each row of the data table \r\n #10    \r\nScenario: Verify pagination icons below data table in manage program\r\n   # Given Admin is on dashboard page after Login\r\n    When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see the text as \"Showing x to y of z entries\" along with Pagination icon below the table.\r\n#11     \r\nScenario: Verify footer message in manage program\r\n    #Given Admin is on dashboard page after Login\r\n    When  Admin clicks \"Program\" on the navigation bar in program module\r\n    Then Admin should see the footer as \"In total there are z programs\".\r\n    \r\n    #--------------------------------------------------------------------------------------------------------\r\n    \r\n    Scenario: Verify add New Program\r\n   # Given  Admin is on Program module\r\n    When Admin clicks on \"New Program\" under the \"Program\" menu bar\r\n    Then Admin should see pop up window for program details\r\n    \r\n  #2\r\n  Scenario: Verify title of the pop up window\r\n    #Given  Admin is on Program module\r\n    When Admin clicks on \"New Program\" under the \"Program\" menu bar\r\n    Then Admin should see window title as \"Program Details\" for popup\r\n    \r\n  #3\r\n   Scenario: Verify mandatory fields with red \"*\" mark \r\n    #Given  Admin is on Program module\r\n    When Admin clicks on \"New Program\" under the \"Program\" menu bar\r\n    Then Admin should see red \"*\" mark beside mandatory field \"Name\" in popup\r\n    \r\n  #4\r\n  \r\n  Scenario: Verify empty form submission\r\n    #Given  Admin is on Program details form\r\n    Given Admin clicks on \"New Program\" under the \"Program\" menu bar\r\n    When  Admin clicks save button without entering mandatory fiels in add new program form\r\n    Then Admin gets message '<field> is required' in popup\r\n    \r\n   Scenario: Verify cancel button\r\n    #Given  Admin is on Program details form\r\n    Given Admin clicks on \"New Program\" under the \"Program\" menu bar\r\n    When  Admin clicks Cancel button in new program form\r\n    Then Admin can see Program Details form disappears\r\n    \r\n    Scenario: Verify enter program name\r\n    Given Admin clicks on \"New Program\" under the \"Program\" menu bar\r\n    When  Admin enters the Name in the text box\r\n    Then Admin can see the program name entered\r\n    \r\n    Scenario: Verify enter description\r\n    Given Admin clicks on \"New Program\" under the \"Program\" menu bar\r\n    When  Admin enters the Description in text box\r\n    Then Admin can see the text entered in description box\r\n    \r\n    Scenario: Verify select Status\r\n   Given Admin clicks on \"New Program\" under the \"Program\" menu bar\r\n    When  Admin selects the status of the program by clicking on the radio button \"(Active\/InActive)\"\r\n    Then Admin can see 'Active\/Inactive' status selected\r\n    \r\n    Scenario: Verify Admin is able to save the program details\r\n    Given Admin clicks on \"New Program\" under the \"Program\" menu bar\r\n    When  Admin enter valid details for mandatory fields and Click on save button\r\n    Then Admin gets message ' Program Created Successfully'\r\n    \r\n    Scenario: Verify cancel program details\r\n   Given Admin clicks on \"New Program\" under the \"Program\" menu bar\r\n    When  Admin Click on cancel button\r\n    Then Admin can see program details form disappear after click on cancel\r\n    \r\n    Scenario: Verify added Program is created\r\n   Given Admin clicks on \"New Program\" under the \"Program\" menu bar\r\n    When  Admin searches with newly created \"Program Name\"\r\n    Then Records of the newly created  \"Program Name\" is displayed and match the data entered\r\n    \r\n    Scenario: Verify close window with \"X\" \r\n    Given Admin clicks on \"New Program\" under the \"Program\" menu bar\r\n    When  Admin Click on \"X\" button\r\n    Then Admin can see program details form disappear\r\n    \r\n  #------------------------Edit Program--------------------------------------------------\r\n  \r\n    Scenario: Verify Edit option \r\n    Given Admin is on Program page\r\n    When  Admin clicks on Edit option for particular program\r\n    Then Admin lands on Program details form\r\n    \r\n    Scenario: Verify title of the pop up window\r\n    Given Admin is on Program page\r\n    When  Admin clicks on Edit option for particular program\r\n    Then Admin should see window title as \"Program Details\"\r\n    \r\n    Scenario: Verify mandatory fields with red asterisk mark \r\n    Given Admin is on Program page\r\n    When  Admin clicks on Edit option for particular program\r\n    Then Admin should see red asterisk mark beside mandatory field \"Name\"\r\n    \r\n    Scenario: Verify edit Program Name \r\n    Given Admin is on Program page\r\n    When  Admin edits the program name and click on save button\r\n    Then Updated program name is seen by the Admin\r\n    \r\n    Scenario: Verify edit Description\r\n    Given Admin is on Program page\r\n    When  Admin edits the description text and click on save button\r\n    Then Admin can see the description is updated\r\n    \r\n    Scenario: Verify edit Status\r\n    Given Admin is on Program page\r\n    When  Admin can change the status of the program and click on save button\r\n    Then Status updated can be viewed by the Admin\r\n    \r\n    Scenario: Verify Admin is able to click Save \r\n    Given Admin is on Program page\r\n    When  Admin click on save button\r\n    Then Admin can see the updated program details\r\n    \r\n    \r\n     Scenario: Verify Admin is able to click Cancel\r\n    Given Admin is on Program page\r\n    When  Admin click on cancel button\r\n    Then Admin can see the Program details form disappears\r\n    \r\n    Scenario: Verify edited Program details\r\n    Given Admin is on Program page\r\n    When  Admin searches with newly updated \"Program Name\"\r\n    Then Admin verifies that the details are correctly updated.\r\n    \r\n    Scenario: Verify close the window with \"X\" \r\n    Given Admin is on Program page\r\n    When  Admin Click on \"X\" button\r\n    Then Admin can see program details form disappear\r\n    \r\n    \r\n    \r\n   # --------------------------------------DELETEProgram------------------------------------------------------------------\r\n    \r\n    Scenario: Admin checks Succes delete operation with single program delete\r\n    Given  Admin clicks \"Program\" on the navigation bar in program module for delete and sort\r\n    When Admin clicks on the delete icon on program module page\r\n    Then Admin able to delete by clicking yes to confirmation pop up\r\n    \r\n     Scenario: Admin checks delete operation unsucces with single program delete\r\n     Given  Admin clicks \"Program\" on the navigation bar in program module for delete and sort\r\n    When Admin clicks on the delete icon on program module page\r\n    Then Admin able to delete by clicking No to confirmation pop up\r\n    \r\n    Scenario: Admin validate delete by deleting multiple programs\r\n    Given  Admin clicks \"Program\" on the navigation bar in program module for delete and sort\r\n    When Admin clicks on the multiple checkboxes on program module page\r\n    And Admin clicks  on the left delete button on program module page\r\n    Then Admin able to delete multiple program by clicking yes to confirm\r\n    \r\n  #----------------------------------Search Program -----------------------------------------  \r\n  \r\n  Scenario: Verify Admin is able to search results found for program name\r\n   Given  Admin is on Program page\r\n    When Admin enter the program to search By program name\r\n    Then Admin should able to see Program name, description, and status for searched program name\r\n    \r\n    Scenario: Verify Admin is able to search results found for program description\r\n   Given  Admin is on Program page\r\n    When Admin enter the program to search By program description\r\n    Then Admin should able to see Program name, description, and status for searched program description\r\n        \r\n   Scenario: Verify Admin is able to search results not found\r\n   Given  Admin is on Program page\r\n    When Admin enter the program to search By program name that does not exist\r\n    Then There should be zero results\r\n    \r\n     Scenario: Verify Admin is able to search with partial program name\r\n   Given  Admin is on Program page\r\n    When Admin enter the program to search By partial name of program\r\n    Then Admin should able to see Program name, description, and status for searched program name\r\n    \r\n    \r\n    #-------------------------Sort-------------------------------------\r\n    \r\n  Scenario: Verify sorting of Program name in Ascending order\r\n   Given  Admin clicks \"Program\" on the navigation bar in program module for delete and sort\r\n    When Admin clicks on Arrow next to program Name of Program module page for sort\r\n    Then Admin See the Program Name is sorted Ascending order in Program module page for sort\r\n\r\n  Scenario: Verify sorting of Program name in Descending order\r\n   Given  Admin clicks \"Program\" on the navigation bar in program module for delete and sort\r\n    When Admin clicks on Arrow next to program Name of Program module page for sort descend\r\n    Then Admin See the Program Name is sorted Descending order in Program module page \r\n\r\n  Scenario: Verify sorting of Program description in Ascending order\r\n   Given  Admin clicks \"Program\" on the navigation bar in program module for delete and sort\r\n    When Admin clicks on Arrow next to program description of Program module page for sort \r\n    Then Admin See the Program description is sorted Ascending order in Program module page \r\n    \r\n  Scenario: Verify sorting of Program description in Descending order\r\n    Given  Admin clicks \"Program\" on the navigation bar in program module for delete and sort\r\n    When Admin clicks on Arrow next to program description of Program module page for sort descend\r\n    Then Admin See the Program description is sorted Descending order in Program module page\r\n\r\n  Scenario: Verify sorting of Program status in Ascending order\r\n    Given  Admin clicks \"Program\" on the navigation bar in program module for delete and sort\r\n    When Admin clicks on Arrow next to program status of Program module page for sort\r\n    Then Admin See the Program status is sorted Ascending order in Program module page\r\n\r\n  Scenario: Verify sorting of Program status in Descending order\r\n    Given  Admin clicks \"Program\" on the navigation bar in program module for delete and sort\r\n    When Admin clicks on Arrow next to program status of Program module page for sor descend\r\n     Then Admin See the Program status is sorted Descending order in Program module page\r\n    \r\n    #----------------------------pagination--------------------------------\r\n    Scenario Outline: Validate pagination links for program page\r\n    When Admin clicks the <pageLink> link on the data table in program page\r\n    Then Admin should see the <pageLink> results on the data table in program module\r\n\r\n  Examples:\r\n      | pageLink   | results                  |\r\n      | Next       | Next enabled link        |\r\n      | Last       | last page link with Next disabled |\r\n      | Previous   | previous page            |\r\n      | First      | very first page          |\r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n  to test Program module"},{"astNodeIds":["3d11c94a-ffd6-4bda-8f0a-b837531d0018"],"id":"b7b08003-8247-4f92-8809-d9eb263be390","type":"Action","text":"Admin enter valid credentials  and clicks login button through keyboard for Program module"},{"astNodeIds":["6189ea52-b72f-489e-96c0-b3a14f2da1cb"],"id":"62b0db7e-a72a-4f64-a742-b6f832d07b21","type":"Outcome","text":"Admin should land on dashboard page On Program module"},{"astNodeIds":["53c4b05e-fac2-4f7a-bd2c-f7a3ff115927","cd4ecbd9-12d6-4360-84ac-0547372b6901"],"id":"57be4433-551e-4697-9f9b-082374688942","type":"Action","text":"Admin clicks the First link on the data table in program page"},{"astNodeIds":["e1cafeed-a21b-47b2-87ae-d78c040e46f2","cd4ecbd9-12d6-4360-84ac-0547372b6901"],"id":"d639b16f-aecb-40e0-a4e3-a600907755fb","type":"Outcome","text":"Admin should see the First results on the data table in program module"}],"tags":[],"astNodeIds":["0c9bde26-c47c-4339-a109-246cf89e415b","cd4ecbd9-12d6-4360-84ac-0547372b6901"]}},{"source":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/04_Batch.feature","data":"Feature: Batch Page Navigation\r\n\r\n  Background: Veryfy Admin is able to login Succesfully\r\n    Given Admin is logged into the LMS portal and on the dashboard page\r\n\r\n  Scenario: Verify Admin Navigate to Batch page successfully\r\n    Given Admin is on LMS Homepage\r\n    When Admin Clicks on the Batch menu from the header\r\n    Then Admin should be in the Manage Batch Page\r\n\r\n  Scenario Outline: Batch Page Elements Validation\r\n    Given Admin is on the home page\r\n    When Admin Clicks on the Batch menu from the header\r\n    Then Admin should see the \"<Elemets>\" on the Batch page\r\n\r\n    Examples: \r\n      | Element                                                                                                |\r\n      | LMS-Learning Management System                                                                         |\r\n      | Manage Batch                                                                                           |\r\n      | Disabled Delete Icon under the header                                                                  |\r\n      | Enabled pagination controls under the data table                                                       |\r\n      | Edit icon in each row                                                                                  |\r\n      | Delete icon in each row                                                                                |\r\n      | Checkbox in each row                                                                                   |\r\n      | Datatable headers Batch name, Batch Description,Batch Status, No Of classes, Program Name, Edit\/Delete |\r\n      | Checkbox in the datatable header row                                                                   |\r\n      | Sort icon next to all Datatable headers                                                                |\r\n\r\n  Scenario Outline: Verify sub menu displayed in batch menu bar\r\n    Given Admin is on batch page\r\n    When Admin clicks \"Add New Batch\" under batch menu bar\r\n    Then Admin should see the Batch Details pop up window \"<menu>\"\r\n\r\n    Examples: \r\n      | Menu                      |\r\n      | Batch Name                |\r\n      | Number of classes         |\r\n      | Description as text box   |\r\n      | Program Name as drop down |\r\n      | Status as radio button    |\r\n      | Save button               |\r\n      | Cancel button             |\r\n      | Close                     |\r\n\r\n  Scenario: Validate batchname prefix selected program name\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin selects program name present in the dropdown\r\n    Then Admin should see selected program name in the batch name prefix box\r\n\r\n  Scenario Outline: Validate batch name suffix box should accept only numbers\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters alphabets and alphanumeric and special character in \"<BatchName>\" suffix box\r\n    Then Admin should get error message below the text box of respective field\r\n\r\n    Examples: \r\n      | BatchName |\r\n      | DB        |\r\n      | BG5       |\r\n      | $$        |\r\n\r\n  Scenario: Validate batch name prefix box is not editable\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters alphabets in batch name prefix box\r\n    Then Admin should see empty text box\r\n\r\n  Scenario: Validate input data only for mandatory fields\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters the data only to the mandatory fields and clicks save button\r\n    Then Admin should get a successful message \"Batch created successfully\"\r\n\r\n  Scenario: validate input data missing for mandatory fields\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin leaves blank one of the mandatory fields\r\n    Then Admin should get a error message on the respective mandatory field\r\n\r\n  Scenario: validate cancel button in Batch details pop up\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters the valid data to all the mandatory fields and click cancel button\r\n    Then Admin can see the batch details popup closes without creating any batch\r\n\r\n  Scenario: validate close icon on the batch details pop up\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin clicks on the close icon\r\n    Then Admin can see batch details pop up closes\r\n\r\n  Scenario: Validate Edit icon feature in any row\r\n    Given Admin is on the Batch page\r\n    When Admin clicks the edit icon\r\n    Then Admin should see the Batch details pop up window\r\n    When Admin clicks the edit icon\r\n    Then Admin should see Program name and Batch name value field is disabled for editing\r\n    When Admin Updates any fields with invalid data and click save button\r\n    Then Admin should get a error message under the respective field\r\n    When Admin enters the valid data to all the mandatory fields and click save button\r\n    Then Admin should get a successful message for editing the batch\r\n    When Admin enters the valid data to all the mandatory fields and click cancel button\r\n    Then Admin can see the batch details popup closes without editing the batch\r\n    When Admin enters the valid data to all the mandatory fields and click close button\r\n    Then Admin can see the batch details popup closes without editing the batch\r\n\r\n  Scenario: validate delete Icon on any row\r\n    Given Admin is on the Batch page\r\n    When Admin clicks the delete Icon on any row\r\n    Then Admin should see the confirm alert box with yes and no button\r\n\r\n  Scenario: Validate yes button on the confirm alert box\r\n    Given Admin is on the batch confirm popup page\r\n    When Admin clicks on the delete icon and click yes button\r\n    Then Admin should see the successful message and the batch should be deleted\r\n\r\n  Scenario: validate no button on the confirm alert box\r\n    Given Admin is on the batch confirm popup page\r\n    When Admin clicks on the delete icon and click no button\r\n    Then Admin should see the alert box closed and the batch is not deleted\r\n\r\n  Scenario: validate close Icon on the alert box\r\n    Given Admin is on the batch confirm popup page\r\n    When Admin clicks on the close icon\r\n    Then Admin should see the alert box closed\r\n\r\n  Scenario: Validate single row delete with checkbox\r\n    Given Admin is on the batch page\r\n    When Admin clicks on the delete icon under the Manage batch header\r\n    Then The respective row in the table should be deleted\r\n\r\n  Scenario: Validate multiple row delete with checkbox\r\n    Given Admin is on the batch page\r\n    When Admin clicks on the delete icon under the Manage batch header\r\n    Then The respective row in the table should be deleted\r\n\r\n  Scenario Outline: Validate pagination links\r\n    Given Admin is on the batch page\r\n    When Admin clicks the <pageLink> link on the data table\r\n    Then Admin should see the <pageLink> results on the data table\r\n\r\n    Examples: \r\n      | pageLink | results                           |\r\n      | Next     | Next enabled link                 |\r\n      | Last     | last page link with Next disabled |\r\n      | Previous | previous page                     |\r\n      | First    | very first page                   |\r\n\r\n  Scenario: validate search box functionality\r\n    Given Admin is on the batch page\r\n    When Admin enters the batch name in the search text box\r\n    Then Admin should see the filtered batches in the data table\r\n\r\n  Scenario: Validate logout option in the header is visible and enabled from the batch page\r\n    Given Admin is on the batch page\r\n    When Admin clicks on the logout button\r\n    Then Admin should see the Login screen Page\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/madhu\/OneDrive\/Desktop\/SDET\/LMS_ActionSquad\/src\/test\/resources\/Feature%20files\/04_Batch.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Batch Page Navigation","description":"","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","name":"Veryfy Admin is able to login Succesfully","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"Admin is logged into the LMS portal and on the dashboard page","id":"7370035c-9175-444a-bcfe-78687b767c0a"}],"id":"307c7ac1-293e-47e8-afee-8412ed0cc2f5"}},{"scenario":{"location":{"line":6,"column":3},"tags":[],"keyword":"Scenario","name":"Verify Admin Navigate to Batch page successfully","description":"","steps":[{"location" in is on login Page\n    When Admin enter valid data in all field and clicks login button\n    Then Admin should see Dashboard section header\n\n  @Welcome\n  Scenario: Verify Welcome Text\n    Given Admin is on login Page\n    When Admin enter valid data in all field and clicks login button\n    Then Admin should see Welcome text\n\n  @ProfileIcon\n  Scenario: Verify User profile icon\n    Given Admin is on login Page\n    When Admin enter valid data in all field and clicks login button\n    Then Admin should see Profile icon\n\n  @TextIcon\n  Scenario Outline: Verify section text and icon\n    Given Admin is on login Page\n    When Admin enter valid data in all field and clicks login button\n    Then Admin should see \"<section>\" text and icon\n\n    Examples: \n      |  section |\n      | User     |\n      | Staff    |\n      | Batches  |\n      | Programs |\n\n  @TableHeader\n  Scenario: Verify Staff data table header\n    Given Admin is on login Page\n    When Admin enter valid data in all field and clicks login button\n    Then Admin should see Staff Data header\n\n  @ColumnHeader\n  Scenario Outline: Verify Staff data table column\n    Given Admin is on login Page\n    When Admin enter valid data in all field and clicks login button\n    Then Admin should see \"<section>\" column header\n\n    Examples: \n      | section    |\n      | UserID     |\n      | First Name |\n      | Last Name  |\n      | Phone      |\n      \n  @Home2Home\n  Scenario: Verify Home Link\n    Given Admin is on home page after Login\n    When Admin clicks Home menu\n    Then Admin should remain in the home page\n\n  @IconLink\n  Scenario Outline: Verify page navigation with icon\n    Given Admin is on home page after Login\n    When Admin clicks \"<module>\" icon\n    Then Admin should be in \"<module>\" page\n\n    Examples: \n      |  module  |\n      | User     |\n      | Staff    |\n      | Batches  |\n      | Programs |\n      \n  @BatchCount\n  Scenario: Validate batch count \n
